import { GitHub, Instagram, LinkedIn, Twitter } from '@material-ui/icons';
import React from 'react';
import styled from 'styled-components';

//  Styled sections
const Container = styled.div`
    display: flex;
`;
const Left = styled.div `
    flex: 1;
    flex-direction: column;
    padding: 20px;
`;
const Center = styled.div `
    flex: 1;
`;
const Right = styled.div `
    flex: 1;
`;
const Logo = styled.h1`
`;
const Description = styled.div`
    margin: 20px 0px;
`;
const Sosmed = styled.div`
    display: flex;
    cursor: pointer;
`;
const SosmedIcon = styled.div`
    width: 40px;
    height: 40px;
    border-radius: 50%;
`;

const Footer = () => {
  return (
    <Container>
        <Left>
            <Logo>Tenun.</Logo>
            <Description>Tenun is a prototype platform for local sellers from Kediri City who wants to increase their business sales, especially in the apparel Batik sector. Made by love @ty000o who owned @numphy.ui</Description>
            <Sosmed>
                <SosmedIcon>
                    <Twitter/>
                </SosmedIcon>

                <SosmedIcon>
                    <Instagram/>
                </SosmedIcon>

                 <SosmedIcon>
                    <LinkedIn color='0072b1'/>
                </SosmedIcon>

                 <SosmedIcon>
                    < GitHub color = '#171515 ' / >
                </SosmedIcon>
            </Sosmed>

        </Left>
        <Center></Center>
        <Right></Right>
    </Container>
  )
}

export default Footer
